import inRange from 'lodash.inrange';
import maxBy from 'lodash.maxby';
import {
  SINGLE_AGE_SCORE,
  MARRIED_AGE_SCORE,
  SINGLE_EDU_SCORE,
  MARRIED_EDU_SCORE,
  SPOUSE_EDU_SCORE,
  EDU_LEVELS,
  EMPLOYER_TYPES,
  CANADA_EDU_DEGREES,
  EMPLOYER_SCORE,
  CANADA_EDU_SCORE,
  SINGLE_FIRST_LAN_SCORE,
  MARRIED_FIRST_LAN_SCORE,
  SECOND_LAN_SCORE,
  SPOUSE_LAN_SCORE,
  SINGLE_EXP_SCORE,
  MARRIED_EXP_SCORE,
  SPOUSE_EXP_SCORE,
  EDU_TRANSFER_SCORE,
